def gc_skew(seq, window=1000):
  skew = []
  for i in range(0,len(seq),window):
    subseq = seq[i:i+window]
    g_count = subseq.count('G')
    c_count = subseq.count('C')
    if g_count + c_count != 0:
      tempskew = (g_count - c_count)/(g_count + c_count)
      skew.append(tempskew)
    else:
      skew.append(0)
  return skew

def at_skew(seq, window=1000):
  skew = []
  for i in range(0,len(seq),window):
    subseq = seq[i:i+window]
    a_count = subseq.count('A')
    t_count = subseq.count('T')
    if a_count + t_count != 0:
      tempskew = (a_count - t_count)/(a_count + t_count)
      skew.append(tempskew)
    else:
      skew.append(0)
  return skew

tempskew = gc_skew(SeqAno, 100)
